-- ----------------------------
-- Table structure for DIC_USER
-- ----------------------------
DROP TABLE "GYSGLBJ"."DIC_USER";
CREATE TABLE "GYSGLBJ"."DIC_USER" (
"ID" VARCHAR2(50 BYTE) DEFAULT sys_guid()  NOT NULL ,
"USER_CODE" VARCHAR2(50 BYTE) NULL ,
"USER_NAME" VARCHAR2(50 BYTE) NULL ,
"PASSWD" VARCHAR2(50 BYTE) NULL ,
"OFFICE_ID" VARCHAR2(50 BYTE) NULL ,
"OFFICE_NAME" VARCHAR2(100 BYTE) NULL ,
"UNIT_ID" VARCHAR2(50 BYTE) NULL ,
"UNIT_NAME" VARCHAR2(100 BYTE) NULL ,
"ROLE_ID" VARCHAR2(50 BYTE) NULL ,
"ROLE_NAME" VARCHAR2(100 BYTE) NULL ,
"REMARK" VARCHAR2(50 BYTE) NULL ,
"FIELD1" NUMBER NULL ,
"FIELD2" VARCHAR2(200 BYTE) NULL ,
"ENTRY_TIME" DATE DEFAULT sysdate  NULL ,
"CREATER_ID" VARCHAR2(50 BYTE) NULL ,
"PARENT_ID" VARCHAR2(50 BYTE) NULL 
)
LOGGING
NOCOMPRESS
NOCACHE

;
COMMENT ON TABLE "GYSGLBJ"."DIC_USER" IS '用户字典表';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."ID" IS '主键ID';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."USER_CODE" IS '用户代码';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."USER_NAME" IS '用户名（显示名）';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."PASSWD" IS '密码';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."OFFICE_ID" IS '科室ID';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."OFFICE_NAME" IS '科室名称';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."UNIT_ID" IS '单位ID';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."UNIT_NAME" IS '单位名称';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."ROLE_ID" IS '角色ID';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."ROLE_NAME" IS '角色名称';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."REMARK" IS '备注';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."FIELD1" IS '预留字段1';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."FIELD2" IS '预留字段2';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."ENTRY_TIME" IS '录入时间';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."CREATER_ID" IS '创建者ID';
COMMENT ON COLUMN "GYSGLBJ"."DIC_USER"."PARENT_ID" IS '父ID';

