-- ----------------------------
-- View structure for VIEW_DIC_USER
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "GYSGLBJ"."VIEW_DIC_USER" AS 
select r.role_name, t.ID, t.USER_NAME,t.passwd, t.USER_CODE, t.OFFICE_ID, t.UNIT_ID, t.ROLE_ID, t.REMARK, t.entry_time, t.PARENT_ID from DIC_USER t left join dic_role r on t.role_id = r.id;

-- ----------------------------
-- View structure for VIEW_QUOTE
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "GYSGLBJ"."VIEW_QUOTE" AS 
SELECT
GYSGLBJ.E_QUOTE.BJH,
GYSGLBJ.E_QUOTE.WZBM,
GYSGLBJ.E_QUOTE.WZMC,
GYSGLBJ.E_QUOTE.GGXH,
GYSGLBJ.E_QUOTE.JSYQ,
GYSGLBJ.E_QUOTE.JLDW,
GYSGLBJ.E_QUOTE.YCSL,
GYSGLBJ.E_QUOTE.DJXJ_BHS,
GYSGLBJ.E_QUOTE.ZXJ_BHS,
GYSGLBJ.E_QUOTE.SYDWJDQ,
GYSGLBJ.E_QUOTE.CSBDJ_BHS,
GYSGLBJ.E_QUOTE.CSBZXJ_BHS,
GYSGLBJ.E_QUOTE.ID,
GYSGLBJ.E_QUOTE.ENTRY_TIME,
GYSGLBJ.E_QUOTE.SUPPLIER_ID,
GYSGLBJ.E_QUOTE.PROJECT_ID,
GYSGLBJ.E_SUPPLIER.QYMC,
GYSGLBJ.E_SUPPLIER.GYSBH
FROM
GYSGLBJ.E_QUOTE
LEFT JOIN GYSGLBJ.E_SUPPLIER ON GYSGLBJ.E_QUOTE.SUPPLIER_ID = GYSGLBJ.E_SUPPLIER.ID;

-- ----------------------------
-- View structure for VIEW_QUOTE_RESULT
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "GYSGLBJ"."VIEW_QUOTE_RESULT" AS 
SELECT
	A ."BJH",
	A ."WZBM",
	A ."WZMC",
	A ."GGXH",
	A ."JSYQ",
	A ."JLDW",
	A ."YCSL",
	A ."DJXJ_BHS",
	A ."ZXJ_BHS",
	A ."SYDWJDQ",
	A ."CSBDJ_BHS",
	A ."CSBZXJ_BHS",
	A ."ID",
	A ."ENTRY_TIME",
	A ."SUPPLIER_ID",
	A ."PROJECT_ID",
	A ."QYMC",
	A ."GYSBH",
	ROW_NUMBER () OVER (
		PARTITION BY A .WZBM
		ORDER BY
			A .CSBZXJ_BHS
	) XH
FROM
	VIEW_QUOTE A
WHERE
	EXISTS (
		SELECT
			COUNT (*)
		FROM
			VIEW_QUOTE
		WHERE
			A .WZBM = WZBM
		AND CSBZXJ_BHS < A .CSBZXJ_BHS
		HAVING
			COUNT (*) < 3
	)
ORDER BY a.bjh, a.WZBM, a.CSBZXJ_BHS;

